import React from "react";
import Navbar from "./component/Navbar.js";
import Filter from "./component/Filter.js";
import Cards from "./component/Cards.js";
import {filterData,apiUrl} from "./data";


const App = () => {
  return (
      <div>
        <Navbar/>
        <Filter data={filterData}/>
        <Cards/> 
      </div>
    );
};

export default App;
